import { useEffect } from "react";
import APIHistory from "../utils/APIHistory";


function History()  {


      useEffect(() => {
          saveHistory()
      }, [])


      function saveHistory() {
        APIHistory.saveHistory({
          historytype: "test",
          username: "test",
          detail: "detail here",
          date: ""
        })
          .catch((err) =>
            console.log(err)
          )
      }


}

export default  History;
